const form = document.getElementById('form');
const request = window.indexedDB.open("pwaDatabase", 1);
let db;

request.onsuccess = function(event) {
  db = request.result;
};

form.addEventListener('submit', (event) => {
	event.preventDefault();
	const formData = new FormData(form);
	const name = formData.get('name');
	const login = formData.get('login');
	const password = formData.get('password');

	if (!name || !login || !password) {
		alert('Please fill in all fields');
		return false;
	}

	const transaction = db.transaction("users", "readwrite").objectStore("users").add({
		'name': name,
		'login': login,
		'password': password
	})

	transaction.onsuccess = function(event) {
    alert("You have signed up sucessfully");
  };
  
  transaction.onerror = function(event) {
    alert(`${login} is aready exist. Please try another login`);
  }
});


